import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './null.scss';
import './sidebarMenu.scss';

export const SidebarMenu = () => {
   const menusSidebar = [
      "Бестселлеры",
      "Новинки",
      "Нехудожественная литература",
      "Художественная литература",
      "Детская литература",
      "Бизнесс литература",
      "Учебная литература",
      "Психология",
      "Комиксы и манга",
      "Изучение иностранных языков", 
      "Медицина",
      "Кулинария и напитки",
      "Красота, здоровья, спорт",
      "Компьютеры и интернет"
   ];
   const menuItems = menusSidebar.map((number) =>
  <Link key={number.toString()} className="linkSidebar"  to>
    {number}
  </Link>
);
   return (
      <aside className="sidebarMenu">
         <nav>
           {menuItems} 
            
         </nav>
      </aside>
   )
}
